<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Elite</title>
</head>
<style>
    body {
        color: #ffffff;
        background: #333333;
    }
    .body {
        position: fixed;
        left: 0;
        right: 0;
        top: 0;
        bottom: 0;
        overflow: hidden;
        text-align: center;
        font-size: 20px;
        font-family: sans-serif;
        width: 100%;
        height: 100%;
        margin: auto;
        padding: auto;
    }

    .UpdateImage {
        position: relative;
        width: 70%;
        height: auto;
        margin: auto;
        margin-top: 2rem;
        background: #ffffff;
        padding: 3%;
        border-radius: 5%;
        object-fit: contain;
    }
    .LoadingIconer {
        position: relative;
        width: 25px;
        height: 25px;
        background: transparent;
        border-radius: 100px;
        padding: 10%;
        margin: auto;
        box-shadow: 0.5px 1px 0.5px 0.5px #dcdcdc80;
        animation: spin 1s linear infinite reverse;
    }
    @keyframes spin {
        0% { transform: rotate(0deg); }
        100% { transform: rotate(-360deg); }
    }
    .FailedInfo {
        font-size: 30px;
        color: red;
        text-align: center;
    }
    .lower {
        font-size: 16px;
        margin: auto;
        margin-top: 1rem;
        margin-bottom: 1rem;
        text-align: center;
    }
    .low {
        font-size: 18px;
        margin: auto;
        margin-top: 1rem;
        margin-bottom: 1rem;
        text-align: center;
    }
    .RetryButton {
        width: 98%;
        height: 50px;
        background: forestgreen;
        color: #ffffff;
        border: none;
        border-radius: 50px;
        margin: auto;
        margin-top: 1rem;
        margin-bottom: 1rem;
    }
    #green {
        color: forestgreen;
    }
    hr {
        background: forestgreen;
        height: 1px;
        border: none;
    }
    .Reconnect{
        position: relative;
        width: 95%;
        height: 50px;
        background: forestgreen;
        border: none;
        border-radius: 5px;
        color: white;
        outline: none;
    }
    .LoadedMessage{
        font-size: 14px;
        font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
    }
    #Offline{
        background: transparent;
        width: 30%;
        height: 30%;
    }

</style>
